package com.aistudio.kaidzentracker.android.domain.fiveSimport com.aistudio.kaidzentracker.android.data.localDataSource.fiveSDataSource.FiveSDataSourceimport com.aistudio.kaidzentracker.android.data.localDataSource.fiveSDataSource.FiveSEntityclass FiveSRepositoryImpl(    private val fiveSDataSource: FiveSDataSource,) : FiveSRepository {    override suspend fun get(): FiveS = with(fiveSDataSource.getLocalSource()) {        FiveS(            firstQuestions = this?.firstQuestions ?: 0.0,            secondQuestions = this?.secondQuestions ?: 0.0,            threeQuestions = this?.threeQuestions ?: 0.0,            fourQuestions = this?.fourQuestions ?: 0.0,            fiveQuestions = this?.fiveQuestions ?: 0.0,            sixQuestions = this?.sixQuestions ?: 0.0,            sevenQuestions = this?.sevenQuestions ?: 0.0,            eightQuestions = this?.eightQuestions ?: 0.0,            nineQuestions = this?.nineQuestions ?: 0.0,            tenQuestions = this?.tenQuestions ?: 0.0,            eleventhQuestions = this?.eleventhQuestions ?: 0.0,            twelfthQuestions = this?.twelfthQuestions ?: 0.0,            thirteenthQuestions = this?.thirteenthQuestions ?: 0.0,            result = this?.result ?: 0.0,            newResult = this?.newResult ?: 0.0,        )    }    override suspend fun delete() {        fiveSDataSource.deleteLocalSource()    }    override suspend fun save(fiveS: FiveS) {        delete()        fiveSDataSource.insertLocalSource(fiveSEntity = mapDomainToEntity(fiveS = fiveS))    }    private fun mapDomainToEntity(fiveS: FiveS): FiveSEntity = with(fiveS) {        FiveSEntity(            firstQuestions = firstQuestions,            secondQuestions = secondQuestions,            threeQuestions = threeQuestions,            fourQuestions = fourQuestions,            fiveQuestions = fiveQuestions,            sixQuestions = sixQuestions,            sevenQuestions = sevenQuestions,            eightQuestions = eightQuestions,            nineQuestions = nineQuestions,            tenQuestions = tenQuestions,            eleventhQuestions = eleventhQuestions,            twelfthQuestions = twelfthQuestions,            thirteenthQuestions = thirteenthQuestions,            result = result,            newResult = newResult,        )    }}